Well, it's not very "clean", but you can try [FORCE_COLOR](https://nodejs.org/dist/latest-v18.x/docs/api/cli.html#force_color1-2-3) env.
```
shelljs.exec(cmd, {
  // ... other options
  stdio: [process.stdin, silent ? null : process.stdout, silent ? null : process.stderr],
  env: { ...process.env, FORCE_COLOR: true },
});
```
